import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View, SafeAreaView, FlatList } from "react-native";

export default function App() {
  return (
    <SafeAreaView style={(styles.body, { flex: 1 })}>
      <View style={styles.container}>
        <Text style={styles.title}>Aplikacja Ratowników Mazowsza</Text>
        <FlatListBasics style={{ flex: 2 }}></FlatListBasics>
      </View>
    </SafeAreaView>
  );
}

const FlatListBasics = () => {
  return (
    <View style={styles.usersList}>
      <FlatList
        data={[
          { key: "Jan", isAvailable: true },
          { key: "Daniel", isAvailable: false },
          { key: "Dominik", isAvailable: true },
          { key: "Jerzy", isAvailable: false },
          { key: "Adam", isAvailable: true },
        ]}
        renderItem={({ item }) => (
          <View>
            {item.isAvailable == true ? (
              <Text style={styles.users}>
                {item.key} - <Text style={styles.available}>Dostępny</Text>
              </Text>
            ) : (
              <Text style={styles.users}>
                {item.key} - <Text style={styles.unavailable}>Niedostępny</Text>
              </Text>
            )}
          </View>
        )}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  body: {
    flex: 1,
    width: "100%",
    height: "100%",
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
    marginLeft: "auto",
    marginRight: "auto",
    backgroundColor: "lightblue",
  },
  container: {
    alignItems: "center",
    flex: 1,
  },
  title: {
    fontSize: "20px",
    fontWeight: "bold",
    marginBottom: "10px",
    marginTop: "10px",
  },
  usersList: {
    marginTop: "20px",
    marginBottom: "20px",
  },
  users: {
    fontSize: "18px",
    marginTop: "15px",
  },
  available: {
    color: "darkgreen",
  },
  unavailable: {
    color: "darkred",
  },
});
